(function(){Vue.component("convos-header-links",{props:["toggle","user"],template:"<div class=\"convos-header-links\">\n    <slot></slot>\n    <template v-if=\"!toggle || !settings.sidebar\">\n      <a :class=\"activeClass(&#39;dialog-settings&#39;)\" v-sidebar.literal=\"#dialog-settings\" v-tooltip.literal=\"Dialog settings\">\n        <i class=\"material-icons\">info</i>\n      </a>\n      <a :class=\"activeClass(&#39;notifications&#39;)\" class=\"notifications\" v-sidebar.literal=\"#notifications\" v-tooltip.literal=\"Show notifications\">\n        <i :class=\"user.unread ? &#39;active&#39; : &#39;&#39;\" class=\"material-icons\">{{user.unread ? &quot;notifications_active&quot; : &quot;notifications_none&quot;}}</i>\n        <b class=\"n-notifications\" v-if=\"user.unread\">{{user.unread &lt; 100 ? user.unread : &quot;99+&quot;}}</b>\n      </a>\n    </template>\n  </div>\n"})})();